import React from 'react';
import './styles.css';
// We import our Welcome component from our components folder so that we can eventually return it.
export default function App() {
  // All functional components must have a return method that contains JSX.
  // We return all the JSX inside a parent element with a className of "container".
  // const Title = "GoGoGrocery";
  return (
    <div className='navbar'>
      <h1 className='title'>GoGoGrocery</h1>
      <input className="navbarSearch" name="SearchInput" placeholder="Search"/>
      <div className='navbarBtn'>
        <div className='login'>
          <h3>Login</h3>
        </div>
        <div className='signup'>
          <h3>Signup</h3>
        </div>

      </div>
    </div>
  );
}
